webpackJsonp([0xd22e1c1c3b9d],{1135:function(e,s){e.exports={data:{package:{id:"unpublished/Risto-Stevcev/bs-abstract",score:0,name:"Risto-Stevcev/bs-abstract",version:"0.10.0",description:"Bucklescript interfaces and implementations for category theory and abstract algebra",keywords:["bucklescript"],license:"BSD-3-Clause",updated:"2018-01-16T07:17:12.573Z",stars:21,type:"unpublished",quality:0,popularity:0,maintenance:0,readme:'<h1 id="bs-abstract"><a href="#bs-abstract" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>bs-abstract</h1>\n<p>Bucklescript interfaces and implementations for category theory and abstract algebra</p>\n<img src="https://raw.githubusercontent.com/Risto-Stevcev/bs-abstract/master/cantellated_tesseract.png" height="100" width="100"/>\n<h2 id="installation"><a href="#installation" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Installation</h2>\n<p>Install the project:</p>\n<p><code>npm install bs-abstract --save</code></p>\n<p>And add the dependency to your bs-dependencies in <code>bsconfig.json</code>:</p>\n<div class="gatsby-highlight">\n      <pre class="hljs lang-json"><code><span class="hljs-string">"bs-dependencies"</span>: [\n  <span class="hljs-string">"bs-abstract"</span>\n]</code></pre>\n      </div>\n<p>The project will be available under the <code>BsAbstract</code> namespace</p>\n<h2 id="project-layout"><a href="#project-layout" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Project Layout</h2>\n<p>This is the current layout of the project. It\'s subject to change:</p>\n<ul>\n<li><a href="https://github.com/Risto-Stevcev/bs-abstract/blob/master/src/interfaces/Interface.re">src/interfaces/Interface.re</a> - Contains the category theory and abstract algebra interfaces</li>\n<li><a href="https://github.com/Risto-Stevcev/bs-abstract/blob/master/src/interfaces/Verify.re">src/interfaces/Verify.re</a> - Contains property based tests to verify that implementations are lawful</li>\n<li><a href="https://github.com/Risto-Stevcev/bs-abstract/blob/master/src/interfaces/Infix.re">src/interfaces/Infix.re</a> - Contains functors to generate infix operators for the interfaces. Modules implementing interfaces contain an already instantiated Infix module for convenience where appropriate</li>\n<li><a href="https://github.com/Risto-Stevcev/bs-abstract/blob/master/src/utilities/Default.re">src/utilities/Default.re</a> - Contains default implementations for interface functions</li>\n<li><a href="https://github.com/Risto-Stevcev/bs-abstract/blob/master/src/utilities/Functors.re">src/utilities/Functors.re</a> - Contains already instantiated functors for common data combinations for convenience</li>\n<li><a href="https://github.com/Risto-Stevcev/bs-abstract/blob/master/src/functions/Functions.re">src/functions/Functions.re</a> - Contains generic functions that are built on top the abstract interfaces</li>\n<li><a href="https://github.com/Risto-Stevcev/bs-abstract/blob/master/src/implementations">src/implementations/</a> - Contains implementations for common bucklescript types </li>\n</ul>\n<p>The rest of the files under <code>src</code> are implementations based on data type (ie: <code>String.re</code> for strings). These files and their corresponding unit tests in the <code>test</code> folder will give you an idea on how to use and implement the interfaces for your own data structures.</p>\n<h2 id="suggested-usage"><a href="#suggested-usage" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Suggested Usage</h2>\n<ul>\n<li>For interfaces based on functors, Use already instantiated functors if available to avoid the extra boilerplate (ie: <code>ArrayF.Int.Additive.Fold_Map.fold_map</code>)</li>\n<li>Don\'t overuse infix operators. If the code is combinatorial it can make it more readable, but a lot of times prefix operators are simpler and easier to read</li>\n<li>If you do use infix operators, prefer local opens over global opens, and prefer explicit unpacking over local opens (ie: <code>let ((&#x3C;.), (>.)) = Function.Infix.((&#x3C;.), (>.))</code>)</li>\n<li>Abbreviated modules can make code terser and easier to read in some situations (ie: <code>A.map</code>), especially in situations where infix operators can\'t be used because they would introduce ambiguity, like for example when two different monoids are used in the same function.</li>\n</ul>\n<p>Example code:</p>\n<div class="gatsby-highlight">\n      <pre class="hljs lang-reason"><code><span class="hljs-class"><span class="hljs-keyword">module</span> <span class="hljs-title">A</span> = <span class="hljs-title">ListF</span>.<span class="hljs-title">Option</span>.<span class="hljs-title">Traversable</span>;\n<span class="hljs-title">assert</span>(<span class="hljs-title">A</span>.<span class="hljs-title">sequence</span>([<span class="hljs-title">Some</span>("<span class="hljs-title">foo</span>"), <span class="hljs-title">Some</span>("<span class="hljs-title">bar</span>")]) == <span class="hljs-title">Some</span>(["<span class="hljs-title">foo</span>", "<span class="hljs-title">bar</span>"]));\n<span class="hljs-title">Js</span>.<span class="hljs-title">log</span>(<span class="hljs-title">ListF</span>.<span class="hljs-title">Int</span>.<span class="hljs-title">Show</span>.<span class="hljs-title">show</span>([1,1,2,3,5,8]));</span></code></pre>\n      </div>\n<p>See the unit tests for many more examples</p>\n<h2 id="side-effects--io"><a href="#side-effects--io" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Side effects / IO</h2>\n<p>See the <a href="https://github.com/Risto-Stevcev/bs-effects">bs-effects</a> package for sync and async implementations of the "IO monad", and\nthe <a href="https://github.com/Risto-Stevcev/bs-free">bs-free</a> package for free monads and other free structures.</p>\n<h2 id="license"><a href="#license" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>License</h2>\n<p>Licensed under the BSD-3-Clause license. See <code>LICENSE</code></p>\n',homepageUrl:"https://github.com/Risto-Stevcev/bs-abstract",repositoryUrl:"https://github.com/Risto-Stevcev/bs-abstract",npmUrl:null,issuesUrl:"https://github.com/Risto-Stevcev/bs-abstract/issues",slug:"packages/unpublished/Risto-Stevcev/bs-abstract"}},pathContext:{id:"unpublished/Risto-Stevcev/bs-abstract"}}}});
